import React from "react";
import "./style.css";

function Header() {
  return (
    <React.Fragment>
        <header className="header">
            <h1>Google Books</h1>
            <h2>Search for Books of your interest and save them</h2>
        </header>
    </React.Fragment>
  )
}

export default Header;
